import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import dayjs from "dayjs";

const Profile = () => {
  const [items, setItems] = useState([]);
  const [user, setUser] = useState(null);
  const [drivers, setDrivers] = useState([]); // Список водителей из базы данных
  const [selectedDriver, setSelectedDriver] = useState(""); // Выбранный водитель
  const apiUrl = "https://bam-app-489c6c1370a9.herokuapp.com";

  // Получение данных пользователя
  useEffect(() => {
    const fetchData = async () => {
      try {
        const username = localStorage.getItem("username");
        setUser(username);

        // Получение всех данных с API
        const response = await axios.get(`${apiUrl}/api/data`);

        // Фильтруем данные для текущего пользователя
        const userItems = response.data.filter(
          (item) => item.user === username
        );
        setItems(userItems);
      } catch (error) {
        console.error("Ошибка при загрузке данных:", error);
      }
    };

    fetchData();
  }, []);

  // Получение списка водителей
  useEffect(() => {
    const fetchDrivers = async () => {
      try {
        const driverResponse = await axios.get(`${apiUrl}/api/drivers`);
        setDrivers(driverResponse.data); // Предполагается, что API возвращает массив водителей
      } catch (error) {
        console.error("Ошибка при загрузке списка водителей:", error);
      }
    };

    fetchDrivers();
  }, []);

  if (!user) {
    return <p>Загрузка...</p>;
  }

  // Вычисляем текущий и предыдущий месяц
  const currentMonth = dayjs().month(); // Текущий месяц
  const previousMonth = dayjs().subtract(1, "month").month(); // Предыдущий месяц

  // Фильтруем заявки за текущий и предыдущий месяцы
  const currentMonthItems = items.filter(
    (item) => dayjs(item.createdAt).month() === currentMonth
  );
  const previousMonthItems = items.filter(
    (item) => dayjs(item.createdAt).month() === previousMonth
  );

  // Фильтруем по выбранному водителю и проверяем наличие item.colorClass
  const filteredItems = items.filter((item) => {
    return (
      (!selectedDriver || item.driver === selectedDriver) && // Если водитель выбран, фильтруем по нему
      item.colorClass !== "" // Проверяем наличие и непустое значение item.colorClass
    );
  });

  // Вычисляем сумму всех значений price и calcPay для отфильтрованных данных
  const totalPrice = filteredItems.reduce((total, item) => {
    const price = parseFloat(item.price) || 0;
    return total + price;
  }, 0);

  const totalCalcPay = filteredItems.reduce((total, item) => {
    const calcPay = parseFloat(item.calcPay) || 0;
    return total + calcPay;
  }, 0);

  return (
    <div>
      <Link to="/">
        <button>Go to Home</button>
      </Link>
      <h1>Профиль пользователя: {user}</h1>
      {/* Инпут для выбора водителя */}
      <div>
        <label htmlFor="driver">Выберите водителя:</label>
        <select
          id="driver"
          value={selectedDriver}
          onChange={(e) => setSelectedDriver(e.target.value)}
        >
          <option value="">Все водители</option>
          {drivers.map((driver, index) => (
            <option key={index} value={driver}>
              {driver}
            </option>
          ))}
        </select>
      </div>
      <p>Количество созданных элементов: {filteredItems.length}</p>
      <p>Общее количество сумм заказов: {totalPrice}</p>
      <p>Общее значение calcPay: {totalCalcPay}</p>
      <p>Количество заявок за текущий месяц: {currentMonthItems.length}</p>
      <p>Количество заявок за предыдущий месяц: {previousMonthItems.length}</p>
    </div>
  );
};

export default Profile;
